import Nav from "./nav/Nav";
import Home from "./home/Home";
import "react-toastify/dist/ReactToastify.css";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";
function App() {
  return (
    <div className="container">
      <header className="App-header">
        <Nav />
        <Home />
      </header>
      <div></div>
    </div>
  );
}

export default App;
